import React, {Component} from 'react';
import {BrowserRouter, Route, Switch} from "react-router-dom";
import Dashboard from "./dashboard/Dashboard";
import {Heading} from "@chakra-ui/react";
import SettingPage from "./setting/SettingPage";
import QuizNewPage from "./quiz_new/QuizNewPage";
import QuizEditor from "./quiz_edit/QuizEditor";
import SidebarWithHeader from "./dashboard/SidebarWithHeader";

class Admin extends Component {
    render() {
        return (
              <SidebarWithHeader>
                  {/*<Switch>*/}
                  {/*    <Route exact path={"/admin"} component={Dashboard}/>*/}
                  {/*    <Route path={"/admin/setting"} component={SettingPage}/>*/}
                  {/*    <Route path={"/admin/quiz/new"} component={QuizNewPage}/>*/}
                  {/*    <Route path={"/admin/quiz/:id/edit"} component={QuizEditor}/>*/}
                  {/*</Switch>  */}
                  <Switch>
                      <Route exact path={"/admin"} component={props=><Dashboard {...props}/>}/>
                      <Route path={"/admin/setting"} component={props=><SettingPage {...props}/>}/>
                      <Route path={"/admin/quiz/new"} component={props=><QuizNewPage {...props}/>}/>
                      <Route path={"/admin/quiz/:id/edit"} component={props=><QuizEditor {...props}/>}/>
                  </Switch>
              </SidebarWithHeader>
        );
    }
}

export default Admin;
